INSERT INTO `stk_score_rule` VALUES (1, 'MA_ALIGNMENT', '均线多头排列', '短期均线在长期均线上方，形成多头排列（MA5 > MA10 > MA20 > MA60），表明趋势向好', 'TECHNICAL', 'FIXED', 20, 20, 1.50, '{\"ma5\":5,\"ma10\":10,\"ma20\":20,\"ma60\":60}', 1, 1, '经典趋势判断指标，权重较高', '2026-02-06 14:06:19', NULL, '2026-02-06 14:06:19', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (2, 'VOLUME_BREAK', '成交量突破', '成交量突破近期平均水平，表明资金关注度提升，可能有主力资金介入', 'TECHNICAL', 'DYNAMIC', 10, 20, 1.20, '{\"period\":20,\"threshold\":1.5}', 1, 2, '成交量是价格变动的先行指标', '2026-02-06 14:06:19', NULL, '2026-02-06 14:06:19', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (3, 'CONTINUOUS_RISE', '连续上涨', '连续N天收盘价上涨，趋势向好，动能强劲', 'TECHNICAL', 'DYNAMIC', 10, 15, 1.00, '{\"minDays\":3,\"maxDays\":5}', 1, 3, '短期趋势强度指标', '2026-02-06 14:06:19', NULL, '2026-02-06 14:06:19', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (4, 'MACD_GOLDEN_CROSS', 'MACD金叉', 'MACD指标DIF上穿DEA，形成金叉买入信号，趋势反转向上', 'TECHNICAL', 'FIXED', 15, 15, 1.30, '{\"fastPeriod\":12,\"slowPeriod\":26,\"signalPeriod\":9}', 1, 4, '经典趋势反转信号', '2026-02-06 14:06:19', NULL, '2026-02-06 14:06:19', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (5, 'BREAK_HIGH', '突破前高', '突破近期高点，创新高表明上涨动能强劲，可能开启新一轮上涨', 'TECHNICAL', 'DYNAMIC', 10, 20, 1.10, '{\"period\":20,\"breakRatio\":1.01}', 1, 5, '突破前高是强势信号', '2026-02-06 14:06:19', NULL, '2026-02-06 14:06:19', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (6, 'RSI_OVERSOLD', 'RSI超卖反弹', 'RSI指标低于超卖线（30）后回升，表明股价可能超跌反弹，是潜在的买入时机', 'TECHNICAL', 'DYNAMIC', 12, 18, 1.20, '{\"period\":14,\"oversoldLine\":30,\"recoveryLine\":40}', 1, 6, 'RSI是经典的超买超卖指标', '2026-02-09 10:55:00', NULL, '2026-02-09 10:55:00', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (7, 'KDJ_GOLDEN_CROSS', 'KDJ金叉', 'KDJ指标K线上穿D线形成金叉，且J值从低位回升，是短期买入信号', 'TECHNICAL', 'DYNAMIC', 12, 18, 1.15, '{\"period\":9}', 1, 7, 'KDJ金叉是常用的短线买入信号', '2026-02-09 10:55:00', NULL, '2026-02-09 10:55:00', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (8, 'BOLLINGER_BREAK', '布林带突破', '价格突破布林带上轨，表明强势上涨，可能开启新一轮行情', 'TECHNICAL', 'DYNAMIC', 10, 16, 1.10, '{\"period\":20,\"multiplier\":2.0}', 1, 8, '布林带突破是趋势启动信号', '2026-02-09 10:55:00', NULL, '2026-02-09 10:55:00', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (9, 'VOLUME_RISE', '放量上涨', '成交量显著放大（超过近期平均1.5倍）且价格上涨，表明资金积极入场', 'TECHNICAL', 'DYNAMIC', 10, 18, 1.25, '{\"period\":5,\"volumeRatio\":1.5,\"priceRatio\":0.02}', 1, 9, '量价配合是技术分析的核心', '2026-02-09 10:55:00', NULL, '2026-02-09 10:55:00', NULL, 0);
INSERT INTO `stk_score_rule` VALUES (10, 'MA_SUPPORT', '均线支撑', '价格回踩均线后获得支撑并反弹，表明均线支撑有效，趋势延续', 'TECHNICAL', 'DYNAMIC', 10, 15, 1.00, '{\"maPeriod\":20,\"touchRatio\":0.02}', 1, 10, '均线支撑是趋势延续的重要信号', '2026-02-09 10:55:00', NULL, '2026-02-09 10:55:00', NULL, 0);
